import React, { useState, useEffect } from 'react';

function MetricsDashboard({ servers, selectedServer }) {
  const [serverMetrics, setServerMetrics] = useState(null);
  const selectedServerData = servers.find(server => server.id === selectedServer);

  useEffect(() => {
    const fetchServerMetrics = async () => {
      if (selectedServer) {
        try {
          const response = await fetch(`http://localhost:8000/servers/${selectedServer}/metrics`);
          if (response.ok) {
            const data = await response.json();
            setServerMetrics(data);
          } else {
            console.error('Failed to fetch server metrics');
            setServerMetrics(null);
          }
        } catch (error) {
          console.error('Error fetching server metrics:', error);
          setServerMetrics(null);
        }
      } else {
        setServerMetrics(null);
      }
    };

    fetchServerMetrics();
  }, [selectedServer]);

  const formatBytes = (bytes) => {
    if (bytes === 0) return '0 Bytes';
    const k = 1024;
    const sizes = ['Bytes', 'KB', 'MB', 'GB', 'TB'];
    const i = Math.floor(Math.log(bytes) / Math.log(k));
    return parseFloat((bytes / Math.pow(k, i)).toFixed(2)) + ' ' + sizes[i];
  };


  return (
    <div>
      <h2>Metrics Dashboard</h2>
      {selectedServerData ? (
        <div>
          <h3>{selectedServerData.name} Metrics</h3>
          {serverMetrics ? (
            <div className="metrics-container">
              <div className="metrics-block">
                <h3>CPU Usage</h3>
                <div className="metric-value">{serverMetrics.cpu_usage.toFixed(1)}%</div>
                <div className="progress-container">
                  <div className="progress-bar" style={{ width: `${serverMetrics.cpu_usage}%`, backgroundColor: 'var(--primary-color)' }}></div>
                </div>
              </div>

              <div className="metrics-block">
                <h3>RAM Usage</h3>
                <div className="metric-value">{serverMetrics.ram_usage.toFixed(1)}%</div>
                <div className="progress-container">
                  <div className="progress-bar" style={{ width: `${serverMetrics.ram_usage}%`, backgroundColor: 'var(--warning-color)' }}></div>
                </div>
              </div>

              <div className="metrics-block">
                <h3>Disk Usage</h3>
                <div className="metric-value">{serverMetrics.disk_usage.toFixed(1)}%</div>
                <div className="progress-container">
                  <div className="progress-bar" style={{ width: `${serverMetrics.disk_usage}%`, backgroundColor: 'var(--secondary-color)' }}></div>
                </div>
              </div>

              <div className="metrics-block">
                <h3>Network Activity</h3>
                <div className="metric-value">
                  ↑ {formatBytes(serverMetrics.network_activity.bytes_sent)} |
                  ↓ {formatBytes(serverMetrics.network_activity.bytes_recv)}
                </div>
                <div className="progress-container">
                  <div className="progress-bar" style={{ width: '60%', backgroundColor: 'var(--danger-color)' }}></div>
                </div>
              </div>
            </div>
          ) : (
            <p>Loading metrics...</p>
          )}
        </div>
      ) : (
        <p>No server selected or available.</p>
      )}
    </div>
  );
}

export default MetricsDashboard;
